  const markers = props.markers.map( marker => <DoctorMarker
                    key={doctor.uid}
                    doctor={doctor}
                    location={{lat: doctor.closestPractice.lat, lng: doctor.closestPractice.lon}}
                  />);
  let actualCenter= props.actualCenter;

  return (
      <GoogleMap
        defaultZoom={14}
        center={ { lat:  actualCenter.lat, lng: actualCenter.lng } }
        >
        {markers}
      </GoogleMap>
    );
  }
))

export default Bidmap;
